INSERT INTO `apps` (`apps_id`, `apps_name`, `apps_logo`, `apps_head`, `apps_caption`, `apps_catalog`, `apps_address`, `apps_phone`, `apps_fav`, `apps_keyword`, `apps_meta_keyword`, `apps_meta_description`, `apps_desc`, `apps_bg`, `apps_fb`, `apps_ig`, `apps_ln`, `apps_youtube`, `apps_mail`, `apps_help`, `apps_term`, `apps_privacy`) VALUES
(1, 'Folarpos Salepoint', 'assets-ds/apps-5a9f6f1c8d63d.png', 'Solusi tepat dan ideal untuk bisnismu', 'Kelola bisnis lebih mudah dan bisa diakses dari manapun secara real time<br><br><br>Coba GRATIS 30 Hari<br> versi FULL FREE & PREMIUM\r\n\r\n', NULL, 'Jl. Kapten Haryadi No. 117B, Sleman, Yogyakrta', '0274883681', 'assets/fav.png', 'point of sale, pos jogja, pos murah, cashier instant, cashier jogja', 'Folarpos, POS, POS Jogja, software toko, software billiard, POS terbaik, point of sales, software resto, software clinic', 'Folarpos provides point of sales application services to facilitate transactions and sales reports of your business.', 'Dukungan teknologi dan layanan yang membantu anda meningkatkan penjualan. Integrasi data diperlukan untuk efisiensi waktu operasional agar bisnis Anda lebih responsif dalam pelayanan. Folarpos menjadi mitra yang efektif dalam memenuhi kebutuhan bisnis anda karena tersedianya layanan software custom ', 'assets-ds/bg-5a9f6f1c8c24d.jpg', 'https://www.facebook.com/Folarpos-Salepoint-1974177922855126', 'https://www.instagram.com/aplikasikasir.folarpos', 'https://www.linkedin.com/company/folarpos-salepoint', '', 'hello@folarpos.co.id', '<p>Bantuan</p>', '<p>Syarat & Ketentuan</p>', '<div>\r\n<p id=\"personal-info\" tabindex=\"-1\">Kami Mungkin Menerima Informasi Pribadi Dari Anda Berdasarkan Interaksi Anda Dengan Kami Pada Platform Media Sosial, Jika Anda Mengirimkan Lamaran Pekerjaan, Internship, Atau Fellowship, Jika Anda Menjadi Sukarelawan Sebagai Anggota Komunitas Folarpos, Jika Anda Mengirimkan Umpan Balik Pengguna Atau Permintaan Kepada Kami, Atau Jika Anda Ikut Serta Dalam Kampanye Tentang Produk Atau Kebijakan.</p>\r\n<p tabindex=\"-1\"> </p>\r\n<ul id=\"personal-info-tabpanel\" tabindex=\"-1\">\r\n<li>\r\n<p><strong>Media Sosial</strong>: Jika Anda Berinteraksi Dengan Akun Media Sosial Kami, Seperti Instagram Dan Facebook, Kami Mungkin Menerima Informasi Pribadi Tentang Anda. Jika Anda Menggunakan Jaringan Ini, Kebijakan Privasinya Berlaku, Dan Sebaiknya Anda Membacanya.</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<ul id=\"personal-info-tabpanel\" tabindex=\"-1\">\r\n<li>\r\n<p><strong>Pelamar Kerja, Internship & Fellowship</strong>: Pelamar Kerja, Program Internship Atau Fellowship Ke Folarpos Wajib Memberikan Nama, Alamat Tempat Tinggal, Nomor Telepon, Alamat Email, Dan Ringkasan Riwayat Hidup (resume) Kepada Folarpos. Kami Menggunakan Informasi Ini Untuk Memroses Dan Mengevaluasi Lamaran Dan Untuk Berkomunikasi Dengan Pelamar Tentang Kesempatan Tersebut.</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<ul id=\"personal-info-tabpanel\" tabindex=\"-1\">\r\n<li>\r\n<p><strong>Kontributor</strong>: Menjadi Sukarelawan Untuk Folarpos Sebagai Kontributor Komunitas Mungkin Mengharuskan Folarpos Dan Pihak Lain Untuk Berkomunikasi Dengan Anda Di Alamat Email Yang Anda Berikan Terkait Kontribusi Tersebut Dan Untuk Menghargai Upaya-upaya Anda. Jika Memungkinkan, Kami Mencoba Meminimalkan Informasi Kontak Yang Ditampilkan Kepada Publik.</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<ul id=\"personal-info-tabpanel\" tabindex=\"-1\">\r\n<li>\r\n<p><strong>Umpan Balik Pengguna</strong>: Anda Dapat Memberikan Umpan Balik Kepada Kami Tentang Produk Dan Layanan Kami Di Situs Web Folarpos Melalui Kontak Kami, Atau Melalui Saluran Seperti Email, Live Chat, Akun Media Sosial. Harap Minimalkan Informasi Pribadi Yang Anda Pilih Untuk Dibagikan Pada Forum-forum Ini Karena Komentar Anda Mungkin Dapat Diakses Publik.</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<ul id=\"personal-info-tabpanel\" tabindex=\"-1\">\r\n<li>\r\n<p id=\"campaigns\"><strong>Kampanye Produk & Kebijakan</strong>: Beberapa Halaman Web Kami Merupakan Tempat Kampanye Produk Atau Kebijakan. Misalnya, Anda Dapat Meminta Tautan Melalui Email Atau SMS Untuk Menginstal Product Dari Folarpos Di Perangkat Anda Atau Mengirimkan Petisi Kepada Legislator Tentang Masalah Product.</p>\r\n</li>\r\n</ul>\r\n</div>');
