INSERT INTO `mg_contents` (`cont_id`, `menu_id`, `users_id`, `cont_title`, `cont_url`, `cont_desc`, `cont_header`, `cont_keyword`, `cont_date`, `cont_date_expired`, `cont_status`) VALUES
(4, 4, 1, 'panduan memilih vendor erp', 'panduan-memilih-vendor-erp', '<h3><a>Panduan Memilih Vendor ERP</a></h3>\r\n<p><em>Software</em> ERP (Enterprise Resource Planning) adalah kumpulan perangkat lunak kompleks yang memiliki kapasitas untuk mengelola lebih dari satu komponen bisnis. Meskipun semakin banyak perusahaan yang memilih <em>software</em> ERP untuk bisnis mereka, namun memilih sistem yang sesuai bukanlah proses yang mudah. Ada beberapa kriteria seperti fungsional, spesifikasi, atau gabungan keduanya yang membantu perusahaan dalam memilih perangkat lunak ini dengan lebih mudah. Selain itu, perusahaan juga perlu mempertimbangkan dari segi anggaran. Setidaknya ada tiga hal yang perlu diperhatikan saat memilih <em>software</em> ERP.</p>\r\n<p>&nbsp;</p>\r\n<h2><strong>1. Memilih Berdasarkan Kebutuhan</strong></h2>\r\n<p>Pertimbangan pertama dan terpenting yang perlu Anda ambil saat memilih sistem ERP adalah kebutuhan perusahaan Anda, karena yang &nbsp;sistem ERP yang dipilih harus memiliki semua fungsi penting yang dibutuhkan perusahaan Anda. Sebagai contoh, jika perusahaan Anda melakukan manajemen inventori, layanan penjualan, melacak laporan pelanggan, akuntansi, dan lainnya, maka <em>software</em> ERP yang dipilih harus mencakup semua modul tersebut dan memiliki fungsi yang baik pada modul-modul tersebut.</p>\r\n<p>Beberapa fungsi perangkat lunak ERP bisa jadi sangat penting bagi beberapa perusahaan, namun tidak penting bagi banyak perusahaan lainnya. Ini karena keseluruhan paket sistem <em>software</em> ERP berisi begitu banyak modul dan Anda perlu membayar sejumlah uang untuk setiap modulnya. Dengan bertambahnya jumlah modul, sistem ERP bisa menjadi paket <em>software </em>yang mahal. Oleh karena itu, banyak perusahaan tidak mau membayar modul yang tidak penting bagi mereka dan hanya mencari fungsi yang diperlukan. Jadi, Anda harus mencari fungsi-fungsi pentingnya atau membuat <a href=\"https://en.wikipedia.org/wiki/Terms_of_reference\" target=\"_blank\">T.O.R</a> terlebih dahulu sebelum Anda memilih<em> software ERP </em>untuk perusahaan Anda.</p>\r\n<p>&nbsp;</p>\r\n<h2>2. Memilih Berdasarkan Proses Bisnis</h2>\r\n<p>Hal kedua yang harus diperhatikan dalam memilih perangkat lunak ERP yakni proses bisnis Anda sendiri. Anda harus mencocokkan paket ERP dengan industri yang sesuai. Beberapa paket ERP dirancang hanya untuk beberapa jenis bisnis tertentu dan tidak sesuai untuk industri lainnya. Untuk memastikan sistem yang sesuai untuk industri Anda, cara terbaiknya adalah memilih paket yang dirancang khusus untuk bisnis Anda <em>(customized software)</em>.</p>\r\n<p>&nbsp;</p>\r\n<h2>3. Berdasarkan Anggaran Perusahaan Anda</h2>\r\n<p>Ketika perusahaan Anda harus membeli <em>software </em>yang biayanya mahal, maka anggaran adalah hal yang paling penting untuk diperhatikan dari semuanya. Akan tetapi, membeli perangkat lunak yang harganya murah mungkin membutuhkan waktu berjalan yang lebih lama dan hasilnya bisa jadi tidak efektif. Dalam kondisi seperti itu, tidak disarankan untuk membeli paket yang mahal. Alih-alih membuang-buang uang Anda pada modul-modul yang tidak diinginkan, sebaiknya pilih opsi yang ramah anggaran dan pilih modul-modul yang benar-benar Anda butuhkan saja.</p>\r\n<p>&nbsp;</p>\r\n<p>Berikut ini kami bantu anda untuk memilih vendor yang cocok untuk kebutuhan ERP anda,</p>\r\n<p><strong>1. <a href=\"https://zahiraccounting.com\" target=\"_blank\">Zahir International</a></strong></p>\r\n<p><strong>2. <a href=\"http://www.sterling-team.com\" target=\"_blank\">SAP Business One</a></strong></p>\r\n<p><strong>3. <a href=\"http://www.folarium.co.id/fpanel/pages/www.folarium.co.id\" target=\"_blank\">Folarium Technomedia</a></strong></p>\r\n<p>Dari ketiga vendor ini mempunyai kelebihan dan kekurangan masing - masing. Apabila perusahaan menginginkan vendor ERP yang berpengalaman dan mempunyai paket lengkap dalam fitur ERP, anda dapat memilih Zahir dan SAP. Namun harga yang ditawarkan sedikit lebih tinggi dan tidak bisa disesuaikan dengan proses bisnis perusahaan anda (tidak bisa <em>customized</em>).&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Jika ini pertama kalinya Anda mencari <em>software</em> ERP, sebaiknya Anda memilih vendor yang dapat memenuhi kebutuhan <em>software</em> anda, dapat menyesuaikan proses bisnis perusahaan anda <em>(customized)</em>, dan dapat menyesuaikan anggaran yang anda siapkan. <a href=\"http://www.folarium.co.id/fpanel/pages/www.folarium.co.id\" target=\"_blank\"><strong>Folarium</strong></a> dapat menjadi solusi yang cocok untuk menjadi partner dalam pembangunan <em>software</em> ERP di perusahaan anda.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Selamat Memilih, Pilihlah yang paling cocok dengan kebutuhan anda</p>', 'assets/photo-pict/for-5a6feb9bc91aa.jpg', 'Panduan Memilih Vendor ERP', '2018-01-30 10:50:51', NULL, 2),
(6, 4, 1, 'forbliz - billiard billing software', 'forbliz-billiard-billing-software', '<p>Forbliz merupakan sistem manajemen billing pada usaha atau bisnis billiard dan dilengkapi dengan instalasi Lamp Relay (Instalasi untuk mengatur hidup mati lampu dimeja permainan).</p>\r\n<p>Berikut adalah fitur unggulan Forbliz (Point Of Sales Billiard Billing) :</p>\r\n<ol>\r\n<li>Billing System - Didukung dengan order, pembayaran, diskon dan pajak</li>\r\n<li>Stock Opname - Membantu mengelola dan memonitoringjumlah stok tersedia</li>\r\n<li>Reporting - Resume Full Daily Report &amp; Monthly Report</li>\r\n<li>Sales Analysis - Average, Best &amp; Low Menu Seller, Visitor Daily&amp; Monthly Finance Income, Spending &amp;Modal Graph</li>\r\n<li>Lamp Relay - Instalasi Relay yang dapat menghidupkan dan mematikan lampu meja permainan secara otomatis</li>\r\n<li>F&amp;B Intergation - Terintergasi dengan transaksi Food &amp; Baverage atau Resto</li>\r\n</ol>\r\n<p>Mau? Konsulasi Gratis gan Klik <a href=\"http://bit.ly/2lIlTYQ\">DISINI!</a></p>', 'assets/photo-pict/for-5a7078c9abe64.jpg', '#', '2018-01-30 20:53:13', NULL, 2),
(7, 4, 1, 'trial 30 hari implementasi software resto forder', 'trial-30-hari-implementasi-software-resto-forder', '<p style=\"text-align: Justify;\">Point Of Sales Atau Software Restoran Yang Baik Juga Biasanya Memiliki Fitur Persediaan Dan Sistem Order Makanan. Software Juga Harus Memiliki Tampilan/antarmuka Yang Enak Dilihat Dan Mudah Digunakan, Serta Fitur Keamanan Data Dan Sistem Manajemen Yang Terpusat Yang Dapat Mendukung Multi Cabang. Hal Tersebut Penting Sebagai Jaminan Investasi Dimasa Depan. <br />Berikut Beberapa Software Restoran Terbaik Yang Merupakan Hasil Kreasi Perusahaan Asal Indonesia.<br /><br /><strong>1. Zahir</strong></p>\r\n<p style=\"margin-right: 20px; margin-top: 10px; float: Left;\"><img style=\"float: Left;\" src=\"http://www.folarium.co.id/assets/image/content/zahir-pos-restoran-7.png\" alt=\"\" width=\"300\" height=\"250\" /></p>\r\n<p style=\"text-align: Justify; margin-top: 20px;\">Zahir Sebelumnya Sudah Populer Dengan Software Akuntasinya. Pada Software Restoran, Zahir Dilengkapi Dengan Fitur Penerapan Diskon \"happy Hour\". Selain Restoran, Software Ini Juga Cocok Untuk Cafe Atau Kedai Kopi. Software Ini Juga Mendukung Laporan Konsolidasi Multi Cabang, Karena Seluruh Data Terintegrasi Dalam Satu Server Sehingga Dapat Memudahkan Dalam Pembuatan Laporan Keuangan Dan Analisa Bisnis. <br />Zahir Sudah Dipakai Oleh Beberapa Restoran Ternama Di Jakarta, Seperti Cafe Batavia, Kambing Bakar Cairo, Kebab Turki Baba Rafi, Choco Corner, Dan Sebagainya.</p>\r\n<p style=\"text-align: Justify; margin-top: 10px;\"><strong>2. FORDER Resto</strong></p>\r\n<p style=\"text-align: Justify; margin-left: 20px; margin-top: 10px; float: Right;\"><img src=\"http://www.folarium.co.id/assets/image/content/Company_Profile_Folarium.png\" alt=\"\" width=\"330\" height=\"220\" /></p>\r\n<p>FORDER Resto Adalah Software Resto Buatan CV. Folarium Technomedia. Ada Banyak Fitur Unggulan Yang Dimiliki Software Ini Selain Harganya Yang Murah Sehingga Sangat Cocok Untuk 